import { Link } from "react-router-dom";

const NFTList = ({ vibes, vibeTitle}) => {

    return (
        <div className="nft-list">
            <h2>{ vibeTitle }</h2>
            <p>sample</p>
            {vibes.map((vibe) => (
                <div className="vibe-preview" key={vibe.id}>
                    <Link to={`/vibes/${vibe.id}`}>
                        <h2>{ vibe.title }</h2>
                    </Link>
                </div>
            ))}
        </div>
    );
}

export default NFTList;
